    function directionSelect(p,c,d,generate,suffix){
        suffix=(typeof suffix=='undefined')?'':'_'+suffix;
        if (typeof generate=='undefined'||generate)
            document.write('<select name="province" id="province'+suffix+'" class="text-control province'+suffix+'"></select><select name="city" id="city'+suffix+'" class="text-control city'+suffix+'"></select><select name="district" id="district'+suffix+'" class="text-control district'+suffix+'"></select>');
        var province_str='',province_id=2,mdc_id=1,city_id=1,city_str='',district_id=1,district_str='',mdc_str='';
        if (typeof p!='undefined' && p!='' && p!=null && p!=0)province_id=p;
        if (typeof c!='undefined' && c!='' && c!=null && c!=0)city_id=c;
        if (typeof d!='undefined' && d!='' && d!=null && d!=0)district_id=d;
        $.each(province,function(key,val){var province_array=val.split("|");province_str+='<option value="'+province_array[1]+'"'+(province_id==province_array[1]?' selected="selected"':'')+'>'+province_array[1]+'</option>';});
        $('select.province'+suffix).html(province_str).change(function(){
            var city_str='';
            $.each(city[parseInt($('select.province'+suffix+' option').index($('select.province'+suffix+' option:selected')))],function(key,val){
                var city_array=val.split("|");
                city_str+='<option value="'+city_array[0]+'"'+(city_id==city_array[0]?' selected="selected"':'')+'>'+city_array[1]+'</option>';
            });
            $(this).siblings('.city'+suffix).html(city_str).next('.district'+suffix).empty();
            if (city[parseInt($('select.province'+suffix+' option').index($('select.province'+suffix+' option:selected')))].length==1&&city[parseInt($('select.province'+suffix+' option').index($('select.province'+suffix+' option:selected')))][0].split('|')[1]==$(this).find('option:selected').text()){
                var district_str='';
                $.each(area[parseInt($('select.province'+suffix+' option').index($('select.province'+suffix+' option:selected')))][parseInt($('select.city'+suffix+' option').index($('select.city'+suffix+' option:selected')))],function(key,val){
                    var district_array=val.split("|");
                    district_str+='<option value="'+district_array[1]+'"'+(district_id==district_array[1]?' selected="selected"':'')+'>'+district_array[1]+'</option>';
                });
                $(this).siblings('select.city'+suffix).hide().change().siblings('select.district').html(district_str);


            }
            else{
                $(this).siblings('select.city'+suffix).show().change();
                $(this).siblings('select.city'+suffix).change();
            }
            if ($('select.mdc_p')){
                $('select.mdc_p').val($('select.province'+suffix).val()).change();
            }
        }).siblings('select.city'+suffix).change(function(){
            var district_str='';
            if (typeof area[parseInt($('select.province'+suffix+' option').index($('select.province'+suffix+' option:selected')))][parseInt($('select.city'+suffix+' option').index($('select.city'+suffix+' option:selected')))]=='undefined')return false;
            $.each(area[parseInt($('select.province'+suffix+' option').index($('select.province'+suffix+' option:selected')))][parseInt($('select.city'+suffix+' option').index($('select.city'+suffix+' option:selected')))],function(key,val){
                var district_array=val.split("|");
                district_str+='<option value="'+district_array[1]+'"'+(district_id==district_array[1]?' selected="selected"':'')+'>'+district_array[1]+'</option>';
            });
            $(this).siblings('.district'+suffix).html(district_str).show();
            if ($('select.mdc_c')){
                $('select.mdc_c').val($('select.city'+suffix).val()).change();
            }
        }).siblings('select.district'+suffix).change(function(){
            if ($('select.mdc_d')){
                $('select.mdc_d').val($('select.district'+suffix).val()).change();
            }
        });

        setTimeout(function(){$('select.province'+suffix).val(province_id).change();},1);
    }
    $.fn.directList=function(p,d,a){
        var o=$(this),tip='请选择';
        o.hover(function(){
            $('#direction-selector .content').show();
        },function(){
            $('#direction-selector .content').hide();
        });
        o.find('.tab li').tabs($('.mc'),null,'current');
        var title=o.find('.text>div');
        var pv=o.find('.tab>.province_val');
        var cv=o.find('.tab>.city_val');
        var av=o.find('.tab>.area_val');
        var provinceStr='';
        var pId,cId,aId,pText='湖北',cText='武汉市',aText='武昌区';
        for (var i=0;i<province.length;i++){
            provinceStr+='<li><a href="javascript:void(0)">'+province[i].split('|')[1]+'</a></li>';
        }
        o.find('.direction_province>ul').html(provinceStr);
        o.find('.content .tab li').click(function(){
            var t=$(this);
            t.show().nextAll('li').hide();
            if (t.hasClass('province_val')){

            }
        });
        o.find('.content .direction_province').click(function(e){
            var pO=$(e.target);
            if (pO.parent('li').length==1)pO=pO.parent('li');
            pId=pO.parent().find('li').index(pO);
            pText=pO.text();
            if (city[pId].length>1)pText+='省';
            pv.find('em').html(pText);
            showCity(pId);
        });
        o.find('.content .direction_city').click(function(e){
            var cO=$(e.target);
            if (cO.parent('li').length==1)cO=cO.parent('li');
            cId=cO.parent().find('li').index(cO);
            cText=cO.text()+'市';
            cv.find('em').html(cText);
            showArea();
        });
        o.find('.content .direction_area').click(function(e){
            var aO=$(e.target);
            if (aO.parent('li').length==1)aO=aO.parent('li');
            aId=aO.parent().find('li').index(aO);
            aText=aO.text();
            title.html(pText+cText+aText);
            o.find('.content').hide();
        });
        var showCity=function(p){
            cv.find('em').html(tip).end().show().click();
            if (city[p].length==1){
                //console.log('直辖市');
                cId=0;
                cText=city[p][0].split('|')[1];
                cText='';
                showArea();
                cv.hide();
            }else if (city[p].length>1){
                var cityStr='';
                for (var i=0;i<city[p].length;i++){
                    cityStr+='<li><a href="javascript:void(0)">'+city[p][i].split('|')[1]+'</a></li>';
                }
                o.find('.direction_city>ul').html(cityStr);
            }
        };
        var showArea=function(){
            av.find('em').html(tip).end().show().click();
            var areaStr='';
            for (var i=0;i<area[pId][cId].length;i++){
                areaStr+='<li><a href="javascript:void(0)">'+area[pId][cId][i].split('|')[1]+'</a></li>';
            }
            o.find('.direction_area>ul').html(areaStr);
        };
    };

    return $;
